pub enum UrlGenerationError {

    /// Resource not found
    #[display(fmt = "Resource not found")]
    ResourceNotFound,

    /// Not all path pattern covered
    #[display(fmt = "Not all path pattern covered")]
    NotEnoughElements,

    /// URL parse error
    #[display(fmt = "{}", _0)]
    ParseError(UrlParseError),
}

pub enum UrlencodedError {

    /// Can not decode chunked transfer encoding.
    #[display(fmt = "Can not decode chunked transfer encoding.")]
    Chunked,

    /// Payload size is larger than allowed. (default limit: 256kB).
    #[display(fmt =
              "URL encoded payload is larger ({} bytes) than allowed (limit: {} bytes).",
              size, limit)]
    Overflow {
        size: usize,
        limit: usize,
    },

    /// Payload size is now known.
    #[display(fmt = "Payload size is now known.")]
    UnknownLength,

    /// Content type error.
    #[display(fmt = "Content type error.")]
    ContentType,

    /// Parse error.
    #[display(fmt = "Parse error: {}.", _0)]
    Parse(FormDeError),

    /// Encoding error.
    #[display(fmt = "Encoding error.")]
    Encoding,

    /// Serialize error.
    #[display(fmt = "Serialize error: {}.", _0)]
    Serialize(FormError),

    /// Payload error.
    #[display(fmt = "Error that occur during reading payload: {}.", _0)]
    Payload(PayloadError),
}

pub enum JsonPayloadError {

    /// Payload size is bigger than allowed. (default: 32kB)
    #[display(fmt = "Json payload size is bigger than allowed")]
    Overflow,

    /// Content type error
    #[display(fmt = "Content type error")]
    ContentType,

    /// Deserialize error
    #[display(fmt = "Json deserialize error: {}", _0)]
    Deserialize(JsonError),

    /// Serialize error
    #[display(fmt = "Json serialize error: {}", _0)]
    Serialize(JsonError),

    /// Payload error
    #[display(fmt = "Error that occur during reading payload: {}", _0)]
    Payload(PayloadError),
}

pub enum PathError {

    /// Deserialize error
    #[display(fmt = "Path deserialize error: {}", _0)]
    Deserialize(serde::de::value::Error),
}

pub enum QueryPayloadError {

    /// Query deserialize error.
    #[display(fmt = "Query deserialize error: {}", _0)]
    Deserialize(serde::de::value::Error),
}

pub enum ReadlinesError {

    /// Payload size is bigger than allowed. (default: 256kB)
    #[display(fmt = "Encoding error")]
    EncodingError,

    /// Payload error.
    #[display(fmt = "Error that occur during reading payload: {}", _0)]
    Payload(PayloadError),

    /// Line limit exceeded.
    #[display(fmt = "Line limit exceeded")]
    LimitOverflow,

    /// ContentType error.
    #[display(fmt = "Content-type error")]
    ContentTypeError(ContentTypeError),
}

pub enum CacheDirective {

    /// "no-cache"
    NoCache,

    /// "no-store"
    NoStore,

    /// "no-transform"
    NoTransform,

    /// "only-if-cached"
    OnlyIfCached,

    /// "max-age=delta"
    MaxAge(u32),

    /// "max-stale=delta"
    MaxStale(u32),

    /// "min-fresh=delta"
    MinFresh(u32),

    /// "must-revalidate"
    MustRevalidate,

    /// "public"
    Public,

    /// "private"
    Private,

    /// "proxy-revalidate"
    ProxyRevalidate,

    /// "s-maxage=delta"
    SMaxAge(u32),

    /// Extension directives. Optionally include an argument.
    Extension(String, Option<String>),
}

pub enum DispositionType {

    /// Inline implies default processing
    Inline,

    /// Attachment implies that the recipient should prompt the user to save the response locally,
    /// rather than process it normally (as per its media type).
    Attachment,

    /// Used in *multipart/form-data* as defined in
    /// [RFC7578](https://tools.ietf.org/html/rfc7578) to carry the field name and the file name.
    FormData,

    /// Extension type. Should be handled by recipients the same way as Attachment
    Ext(String),
}

pub enum DispositionParam {

    /// For [`DispositionType::FormData`] (i.e. *multipart/form-data*), the name of an field from
    /// the form.
    Name(String),

    /// A plain file name.
    ///
    /// It is [not supposed](https://tools.ietf.org/html/rfc6266#appendix-D) to contain any
    /// non-ASCII characters when used in a *Content-Disposition* HTTP response header, where
    /// [`FilenameExt`](DispositionParam::FilenameExt) with charset UTF-8 may be used instead
    /// in case there are Unicode characters in file names.
    Filename(String),

    /// An extended file name. It must not exist for `ContentType::Formdata` according to
    /// [RFC7578 Section 4.2](https://tools.ietf.org/html/rfc7578#section-4.2).
    FilenameExt(ExtendedValue),

    /// An unrecognized regular parameter as defined in
    /// [RFC5987](https://tools.ietf.org/html/rfc5987) as *reg-parameter*, in
    /// [RFC6266](https://tools.ietf.org/html/rfc6266) as *token "=" value*. Recipients should
    /// ignore unrecognizable parameters.
    Unknown(String, String),

    /// An unrecognized extended parameter as defined in
    /// [RFC5987](https://tools.ietf.org/html/rfc5987) as *ext-parameter*, in
    /// [RFC6266](https://tools.ietf.org/html/rfc6266) as *ext-token "=" ext-value*. The single
    /// trailing asterisk is not included. Recipients should ignore unrecognizable parameters.
    UnknownExt(String, ExtendedValue),
}

pub enum ContentRangeSpec {

    /// Byte range
    Bytes {
        /// First and last bytes of the range, omitted if request could not be
        /// satisfied
        range: Option<(u64, u64)>,
        /// Total length of the instance, can be omitted if unknown
        instance_length: Option<u64>,
    },

    /// Custom range, with unit not registered at IANA
    Unregistered {
        /// other-range-unit
        unit: String,
        /// other-range-resp
        resp: String,
    },
}

pub enum Encoding {

    /// The `chunked` encoding.
    Chunked,

    /// The `br` encoding.
    Brotli,

    /// The `gzip` encoding.
    Gzip,

    /// The `deflate` encoding.
    Deflate,

    /// The `compress` encoding.
    Compress,

    /// The `identity` encoding.
    Identity,

    /// The `trailers` encoding.
    Trailers,

    /// Some other encoding that is less common, can be any String.
    EncodingExt(String),
}

pub enum IfMatch {

    /// Any value is a match
    Any,

    /// Only the listed items are a match
    Items(Vec<EntityTag>),
}

pub enum IfNoneMatch {

    /// Any value is a match
    Any,

    /// Only the listed items are a match
    Items(Vec<EntityTag>),
}

pub enum IfRange {

    /// The entity-tag the client has of the resource.
    EntityTag(EntityTag),

    /// The date when the client retrieved the resource.
    Date(HttpDate),
}

pub enum ErrorHandlerResponse<B> {

    /// Immediate HTTP response.
    Response(ServiceResponse<B>),

    /// A future that resolves to an HTTP response.
    Future(LocalBoxFuture),
}

pub enum ErrorHandlersFuture<Fut, B> where Fut: Future {
    ServiceFuture {
        #[pin]
        fut: Fut,
        handlers: Handlers<B>,
    },
    HandlerFuture {
        fut: LocalBoxFuture,
    },
}

pub enum TrailingSlash {

    /// Trim trailing slashes from the end of the path.
    ///
    /// Using this will require all routes to omit trailing slashes for them to be accessible.
    Trim,

    /// Only merge any present multiple trailing slashes.
    ///
    /// This option provides the best compatibility with behavior in actix-web v2.0.
    MergeOnly,

    /// Always add a trailing slash to the end of the path.
    ///
    /// Using this will require all routes have a trailing slash for them to be accessible.
    Always,
}

pub enum Either<L, R> {

    /// A value of type `L`.
    Left(L),

    /// A value of type `R`.
    Right(R),
}

pub enum EitherExtractError<L, R> {

    /// Error from payload buffering, such as exceeding payload max size limit.
    Bytes(Error),

    /// Error from primary extractor.
    Extract(L, R),
}

pub enum JsonBody<T> {
    Error(Option<JsonPayloadError>),
    Body {
        limit: usize,
        length: Option<usize>,
        #[cfg(feature = "compress")]
        payload: Decompress<Payload>,
        buf: BytesMut,
        _res: PhantomData<T>,
    },
}
